&quot;Пора узнать, из чего сделаны драконы!
Команда космического корабля «Королева За́за» зарабатывает на жизнь охотой на драконов. Поймай добычу и помимо награды получишь столько мяса, сколько сможешь съесть, но помни, что добычей можешь стать ты сам.
Присоединяйтесь к экипажу корабля, и вас ждёт увлекательное кулинарное путешествие!&quot;

&quot;2043-й год, в свет выходит первая полноценная ММО с полным погружением — [Бесконечный Дендрограм]. Помимо возможности полностью симулировать все пять человеческих чувств и прочих прорывных возможностях, игра предлагает геймерам огромный мир, где возможно всё.
Два года спустя, скорый выпускник колледжа Рэ́йджи Мукудо́ри наконец находит время купить и опробовать нашумевший проект. С помощью уже давно играющего старшего брата Шу, и своего друга Э́мбрио, Рэ́йджи отправляется в путешествие по миру [Бесконечного Дендрограма]. 
Какие тайны и приключения ждут товарищей в мире бесконечных возможностей и удивительного реализма?&quot;
